frontApp.controller("postController",["$scope","$http","$window","$sce",function(n,t,i,r){n.post={};n.relatedPosts=[];n.idCategoryPost="";n.idPost=angular.element("#idPost").val();t.get("/API/PostsAPI/"+n.idPost).success(function(i){n.post=i;n.post.content=r.trustAsHtml(i.content);n.idCategoryPost=i.idCategoryPost;t.get("/API/PostsAPI/").success(function(t){angular.forEach(t,function(t){t.idCategoryPost==n.idCategoryPost&&t.idPost!=n.idPost&&n.relatedPosts.push(t)})})})}]);